From producer Guillermo del Toro and director Jorge Gutierrez comes 
an animated comedy with a unique visual style. THE BOOK OF LIFE 
is the journey of Manolo, a young man who is torn between fulfilling the 
expectations of his family and following his heart. Before choosing which 
path to follow, he embarks on an incredible adventure that spans three
 fantastical worlds where he must face his greatest fears. Rich with a
 fresh take on pop music favorites, THE BOOK OF LIFE encourages
 us to celebrate the past while looking forward to the future. 


